import React from "react";
import Data from "../example_data.json";

import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Typography from "@mui/material/Typography";
import Avatar from "@mui/material/Avatar";
import FiberManualRecordIcon from "@mui/icons-material/FiberManualRecord";

import ImageList from "@mui/material/ImageList";
import ImageListItem from "@mui/material/ImageListItem";
import {CardActionArea, Grid} from "@mui/material";
import {borderColor, flexbox} from "@mui/system";
import {Box} from "@mui/material";

export const PlaceList = () => {
  const Date = (value) => {
    return value
      .filter((item) => item.day === "Monday")
      .map((item) => `${item.time_open} AM - ${item.time_close} PM`);
  };

  const info = Data.map((item) => (
    <Grid item xs={6} md={8}>
      <Card
        key={item.id}
        sx={{
          bgcolor: "background.paper",
          m: 1,
          border: 1,
          borderColor: "primary.main",
          width: "100px",
          // maxWidth: 300,
        }}>
        <CardHeader
          avatar={
            <Avatar src={item.profile_image_url} variant="rounded">
              {" "}
              {item.id}
            </Avatar>
          }
          action={<FiberManualRecordIcon />}
          title={item.name}
          subheader={Date(item.operation_time)}
        />

        <Box
          sx={{
            // display: "flex",
            alignItem: "center",
            justifyContent: "center",
            width: "500px",
          }}>
          <ImageList
            gap={0}
            sx={{
              padding: 0,
              maxWidth: "500px",
              height: "auto",
              border: 1,
              borderRadius: "25px",
            }}
            cols={3}>
            {item.images.map((imgs, index) => (
              <ImageListItem key={index}>
                <img src={`${imgs}`} loading="lazy" />
              </ImageListItem>
            ))}
          </ImageList>
        </Box>
      </Card>
    </Grid>
  ));

  return (
    <Box sx={{flexGrow: 2}}>
      <Grid container spacing={2}>
        {info}
      </Grid>
    </Box>
  );
};
